import React from 'react';
import Slider from 'react-slick';

const settings = {
  dots: true,
  infinite: true,
  speed: 500,
  slidesToShow: 1,
  slidesToScroll: 1,
  autoplay: false,
};
export default function Carrousel() {
  return (
    <>
      <Slider {...settings}>
        <div>
          <div>
            <div className="image-container">
              <img src="/carrousel/carrousel-item-1.jpg" alt="item-1" align="center" />
              <div className="text-block">
                <p>
                  Puto el que lo lea
                </p>
              </div>
            </div>
          </div>
        </div>
        <div>
          <div className="image-container">
            <img src="/carrousel/carrousel-item-2.jpg" alt="item-1" align="center" />
          </div>
        </div>
      </Slider>
      <style jsx>
        {`
        .image-container {
          max-width: 100vw;
          height: 500px;
          position: relative;
        }
        .image-container img {
          width: 100%;
          color: black;
          object-fit: cover;
          vertical-align: center;
        }
        .image-container div{
          position: absolute;
          top: 0;
          right: 50%;
          background-color: black;
          color: white;
          padding-left: 20px;
          padding-right: 20px;
        }
        `}
      </style>
    </>
  );
}
